+ (void)insertEmoticon:(NSString *)_phrase
			  filename:(NSString *)_filename
				  type:(NSString *)_type
				 width:(int)_width
				height:(int)_height
	 defaultFrameIndex:(int)_defaultFrameIndex
				delays:(NSArray*)_delays {
	Emoticon *emoticon = [[Emoticon alloc]initWithPhrase:_phrase
												filename:_filename
													type:_type
												   width:_width
												  height:_height
									   defaultFrameIndex:_defaultFrameIndex
												  delays:_delays];
	[gEmoticons addObject:emoticon];
	[emoticon release];
	
	NSMutableDictionary *_emoticonTypes = [EmoticonDataSource emoticonTypes];
	NSString *key = [_emoticonTypes objectForKey:_type];
	if (!key) {
		key = _type;
	}
	
	NSMutableArray *emoticons = [gEmoticonNodes objectForKey:key];
	if (emoticons == nil) {
		emoticons = [NSMutableArray array];
	}
    //davewang
	GifEmoticonNode *node = [[GifEmoticonNode alloc]initWithEmoticon:emoticon];
	[emoticons addObject:node];
	[node release];
	[gEmoticonNodes setObject:emoticons forKey:key];
	
}

+ (NSMutableArray *)getEmoticonNodes:(NSString *)_type {
	NSMutableDictionary *_emoticons = [EmoticonDataSource emoticonNodes];
	return [_emoticons objectForKey:_type];
}


+ (NSMutableArray *)loadRecentEmoticonNodes {
	if (gRecentEmoticonNodes) {
		return gRecentEmoticonNodes;
	}
	NSString *filePath = [PathHelper getCurrentUserStoreagePath:@"recentEmoticonNodes.db"];
	NSMutableArray *_recentNodes = [NSKeyedUnarchiver unarchiveObjectWithFile:filePath];
	gRecentEmoticonNodes = [_recentNodes retain];
	if (!gRecentEmoticonNodes) {
		gRecentEmoticonNodes = [[NSMutableArray alloc] init];
	}
	return gRecentEmoticonNodes;
}

+ (void)addRecentEmoticonNodes:(GifEmoticonNode *)node {
	if (!gRecentEmoticonNodes) {
		[EmoticonDataSource loadRecentEmoticonNodes];
	}
	int i = 0;
	int maxLength = 100;
	NSMutableArray *nodes = [NSMutableArray array];
	[nodes addObject:node];
	for (GifEmoticonNode *en in gRecentEmoticonNodes) {
		i++;
		if ([en.phrase isEqualToString:node.phrase]) {
			continue;
		}
		[nodes addObject:en];
		if (i >= maxLength - 1) {
			break;
		}
	}
	[gRecentEmoticonNodes release];
	gRecentEmoticonNodes = [nodes retain];	
	
	NSString *filePath = [PathHelper getCurrentUserStoreagePath:@"recentEmoticonNodes.db"];
	[NSKeyedArchiver archiveRootObject:gRecentEmoticonNodes toFile:filePath];
}



