+ (NSMutableDictionary *)emoticonNodes {
	if (gEmoticonNodes) {
		return gEmoticonNodes;
	}
	
	if (!gEmoticonNodes) {
		gEmoticonNodes = [[NSMutableDictionary alloc] init];
	}
	
	[EmoticonDataSource insertEmoticons];
	
	return gEmoticonNodes;
	
}

+ (NSMutableArray *)emoticons {
	if (gEmoticons) {
		return gEmoticons;
	}
	
	if (!gEmoticons) {
		gEmoticons = [[NSMutableArray alloc] init];
	}
	
	[EmoticonDataSource insertEmoticons];
	
	return gEmoticons;
}

